def pretextmap(bin, dir, full_test=True):
    with Popen(bin, stdout=PIPE, stderr=STDOUT) as process:
        process.communicate()

    if full_test:
        read, write = os.pipe()

        def thread_fn():
            with os.fdopen(write, "wb") as file:
                file.write(bz2.decompress(sam))

        thread = Thread(target=thread_fn)
        thread.start()

        map_path = os.path.join(dir, "test.map")

        with Popen(
            (bin + " -o " + map_path).split(),
            stdout=PIPE,
            stderr=STDOUT,
            stdin=Popen(
                "samtools view -h -".split(), stdout=PIPE, stderr=STDOUT, stdin=read
            ).stdout,
        ) as process:
            process.communicate()

        thread.join()

        with open(map_path, "rb") as file:
            assert file.read() == bz2.decompress(pretext_map)


def test_pretextmap(tmpdir):
    pretextmap("./PretextMap", tmpdir, full_test=("linux" in sys.platform))


